import { useState, useEffect } from "react";
import axios from 'axios';


const UseFetchExchanges = (cur0, cur1) => {
    const [data, setData] = useState(null);
    const url = 'https://openexchangerates.org/api/latest.json?app_id=01341f5261444649a612793df73c7130'

    console.log('----1-----');
    console.log(data);

    const fetchData = async () => {
        try {
            const response = await axios.get(url);
            setData(response.data)
        } catch (error) {
            console.error(error);
        }
    };

    useEffect(
        () => {
            fetchData();
        }, [cur0, cur1]
    )

    return data;
}

export default UseFetchExchanges;
